import React from 'react';
import RenderPageTitle from '../widgets/pageTitleComponent';
import SpecialtiesBanner from '../widgets/specialtiesBanner';
import SpecialtiesCarousel from '../widgets/specialtiesCarousel';

const Specialties = (props) => {

    function codeSamples() {
        return(
            <div className="row">
                <div className="col">
                    <div>
                        <h2>Want to see code samples?</h2>
                        <h4>I'm constantly experimenting with new GitHub libraries and coding techniques. Click here to see some of my all-time favorites.</h4>
                    </div>
                </div>

                <div className="col">
                <a href="http://horrors.lawrencemcdaniel.com/" title="AngularJS Code Samples" target="_blank" rel="noopener noreferrer"><i className="vc_btn3-icon fa fa-cogs"></i> Code samples</a>
                </div>
            </div>
        );
    }

    return(
        <React.Fragment>
            <div className="specialties-page">
                <div className="container site-page ">
                    <RenderPageTitle icon="fa-pencil-square-o" title="MY" boxed_title="SPECIALTIES" />
                    <SpecialtiesBanner />
                    <SpecialtiesCarousel />
                    <codeSamples />
                </div>
            </div>              

        </React.Fragment>
    );

}

export default Specialties;
